def scoreMove(move):
    if move=='A' or move=='X':
        return 1
    elif move=='B' or move=='Y':
        return 2
    elif move=='C' or move=='Z':
        return 3
def translateMove(move):
    if move=='A':
        return 'X'
    elif move=='B':
        return 'Y'
    elif move=='C':
        return 'Z'
def partOneResult(turnPlay):
    # 0 - lost, 3 - draw, 6 - victory
    oppMove = turnPlay[0]
    myMove = turnPlay[1]
    if (oppMove=='A' and myMove=='Z') or (oppMove=='B' and myMove=='X') or (oppMove=='C' and myMove=='Y'):
        return 0 + scoreMove(myMove)
    elif (translateMove(oppMove)==myMove):
        return 3 + scoreMove(myMove)
    else:
        return 6 + scoreMove(myMove)

print(f"Part One - { sum(list(map(partOneResult,input))) }")

def whatToPlay(move,shouldWin):
    if shouldWin:
        if move=='A':
            return 'B'
        elif move=='B':
            return 'C'
        elif move=='C':
            return 'A'
    else:
        if move=='A':
            return 'C'
        elif move=='B':
            return 'A'
        elif move=='C':
            return 'B'
def scoreMove2(move):
    if move=='A':
        return 1
    elif move=='B':
        return 2
    elif move=='C':
        return 3
    elif move=='X':
        return 0
    elif move=='Y':
        return 3
    elif move=='Z':
        return 6
def partTwoResult(turnPlay):
    oppMove = turnPlay[0]
    myMove = turnPlay[1]
    if myMove=='X':
        return scoreMove2(whatToPlay(oppMove, False)) + scoreMove2(myMove)
    elif myMove=='Y':
        return scoreMove2(oppMove) + scoreMove2(myMove)
    elif myMove=='Z':
        return scoreMove2(whatToPlay(oppMove, True)) + scoreMove2(myMove)
    

print(f"Part Two - { sum(list(map(partTwoResult,input))) }")